;; **
;;; ## 5.3 Traces
;;; 
;;; In many cases, we are not interested in the entire history graph of a @@grape@@. Rather, we may just be interested the derivation steps that led to a particular graph. We call the (linear) sequence of derivation steps that let to a particular graph the __trace__ of that graph.
;;; 
;;; Anologously to history graphs, traces can be represented in graph form (showing linear chains of derivations).
;;; 
;;; The `traces` form computes a graph trace for all graphs in a given @@grape@@:
;; **

;; @@
(-> (newgrape) hello hello world* vine traces view )
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"424\" height=\"669\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5905dc4f \"BufferedImage@5905dc4f: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 669 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x5905dc4f \"BufferedImage@5905dc4f: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 669 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 424, :height 669})"}
;; <=

;; **
;;; Of course, we can also view details of the derivation steps on traces:
;; **

;; @@
(-> (newgrape) hello hello world* vine traces steps viewsteps )
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"377\" height=\"679\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1f8a84ba \"BufferedImage@1f8a84ba: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 377 height = 679 #numDataElements 3 dataOff[0] = 2\"]"}
