;; **
;;; # 6. Graph Constraints
;;; 
;;; Graph constraints define conditions on the state of graphs. Graph constraints are defined based on a notion of an _atomic graph constraint_ of form **if @@X@@ then @@C@@**, where @@X@@ describes a pattern to be searched for in a graph and @@C@@ describes a necessary extension of that pattern for all found matches. 
;;; 
;;; This concept of an atomic graph constraint (_atomic constraint_ for short) has been formalized as @@\forall(c:X \longrightarrow C)@@ (see [Orejas et al.](https://dl.acm.org/doi/10.5555/1792838.1792857) for details).
;;; 
;;; ## 6.1 Basic constraints
;;; 
;;; An atomic constraint where @@X=\emptyset@@ is called a _basic atomic constraint_ or _basic constraint_ for short. It can be written as @@\exists C@@.
;;; 
;;; Consider the following basic constraint, which matches a `Hello` node that is connected to a `Grape` node via a `to` edge.
;;; 
;;; > _Note: By convention, names of constrains should end with a exclamation mark._
;;; 
;; **

;; @@
(constraint hello-to->grape! []
   (node h:Hello)
   (node p:Grape)
   (edge :to h p))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"275\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6b461f03 \"BufferedImage@6b461f03: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 275 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; 
;; **

;; **
;;; ## 6.2 Using constraints to filter @@grapes@@
;;; 
;;; Like rules, constraints can be applied to _grapes_ and filter out those graphs that do not satisfy the constraint. Applications can be positive or negated.
;;; 
;;; Let's try:
;; **

;; @@
(hello-to->grape! (newgrape))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; As expected, the above pattern cannot be found in an empty graph. Let's apply the constraint in negated form. (i.e., we assert that the "hello-to->grape!" pattern may not exist). This is done by appending a minus sign (**-**) to the call of the constraint.
;; **

;; @@
(hello-to->grape!- (newgrape))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;58f10c30-05ab-4115-9159-1e1f77305873&quot;</span>","value":"\"58f10c30-05ab-4115-9159-1e1f77305873\""}],"value":"(\"58f10c30-05ab-4115-9159-1e1f77305873\")"}
;; <=

;; **
;;; We we see above that the empty graph satisfies this negated constraint.
;;; 
;;; Conversely, let's generate a graph that satisfies the positive constraint (see below):
;; **

;; @@
(-> (newgrape) hello world vine hello-to->grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;7db103d9-b907-42bf-8b69-39c87264ada6&quot;</span>","value":"\"7db103d9-b907-42bf-8b69-39c87264ada6\""}],"value":"(\"7db103d9-b907-42bf-8b69-39c87264ada6\")"}
;; <=

;; **
;;; Observe that testing a graph constraint only returns a graph _if_ it satisfies the constraint.
;;; 
;;; > _Graph constraints can act as filters on @@grapes@@. They filter out all graphs that do not satisfy the constraint._
;;; 
;;; Let's see another example with the `rel` rule defined earlier. As previously noted, the applying that rule to a graph with two `Hello` nodes produces two unique graphs (four if we use a starred rule application).
;;; 
;; **

;; @@
(-> (newgrape) hello hello rel view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"424\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x549094b0 \"BufferedImage@549094b0: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 424 height = 251 #numDataElements 4 dataOff[0] = 3\"]"},{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"424\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x64eb9f9c \"BufferedImage@64eb9f9c: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x549094b0 \"BufferedImage@549094b0: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 424 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 424, :height 251} #gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x64eb9f9c \"BufferedImage@64eb9f9c: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 133 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 424, :height 133})"}
;; <=

;; **
;;; Now let's consider the following constraint `self-related!`, which matches a node that has a relationship with itself:
;; **

;; @@
(constraint self-related! []
       (node h)
       (edge e:rel h h ))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"243\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x39283f52 \"BufferedImage@39283f52: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 243 height = 133 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; As we can see below, applying the graph constraint filters out those graphs that do not contain a "self-related" node:
;; **

;; @@
(-> (newgrape) hello hello rel self-related! view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"424\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x47341253 \"BufferedImage@47341253: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x47341253 \"BufferedImage@47341253: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 424 height = 133 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 424, :height 133})"}
;; <=

;; **
;;; Conversely, applying the negated constraint exclude graphs that satisfy the constraint:
;; **

;; @@
(-> (newgrape) hello hello rel self-related!- view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"431\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xf7a8e38 \"BufferedImage@f7a8e38: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 431 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0xf7a8e38 \"BufferedImage@f7a8e38: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 431 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 431, :height 251})"}
;; <=

;; **
;;; 
;; **

;; **
;;; ## 6.3 Atomic Constraints
;;; 
;;; As described above, atomic constraints have the general form **if @@X@@ then @@C@@**. (Remember that basic constraints are a special case, were the pattern @@X@@ is empty, intuitively: _if TRUE then @@X@@_)
;;; 
;;; Below is an example for an atomic constraint that is _not_ a basic constraint. A graph satisfies this constraint if (and only if) all `Hello` nodes are connected to a `Grape` node by a `to` edge.
;;; 
;;; As we can see, the pattern that belongs to the "if" part is represented in black colour.
;;; 
;; **

;; @@
(cond-constraint if-hello-then-to-grape! []
       (IF   (node h:Hello))
       (THEN (node p:Grape)
               (edge :to h p)))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"319\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2ea53ef3 \"BufferedImage@2ea53ef3: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 319 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; An empty graph satisfies this constraint:
;; **

;; @@
(-> (newgrape) if-hello-then-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;06b2b797-0b57-4552-8a42-012b433e21d9&quot;</span>","value":"\"06b2b797-0b57-4552-8a42-012b433e21d9\""}],"value":"(\"06b2b797-0b57-4552-8a42-012b433e21d9\")"}
;; <=

;; **
;;; The following graph does not:
;; **

;; @@
(-> (newgrape) hello world if-hello-then-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; But this one does:
;; **

;; @@
(-> (newgrape) hello world vine if-hello-then-to-grape! view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"424\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x38afb1e6 \"BufferedImage@38afb1e6: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 424 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x38afb1e6 \"BufferedImage@38afb1e6: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 424 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 424, :height 251})"}
