;; **
;;; ## 6.4 Constraint clauses
;;; 
;;; In mathematical logic, a _clause_ is a formula of the form @@L_1 \vee ... \vee L_n@@, where each @@L_i@@ is a positive or negative literal. 
;;; 
;;; @@GrapeVine@@ provides the `constraint-clause` form for defining constraints in clausal form, where each literal is a positive or negative atomic constraint. For example, the form below defines a constraint claus (named `self-or-not-hello-to-grape!`) as a disjunction of the two atomic constraints `self-related!` and `if-hello-then-to-grape!`).
;; **

;; @@
(constraint-clause  self-or-not-hello-to-grape! 
                    [self-related! if-hello-then-to-grape!])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/self-or-not-hello-to-grape!</span>","value":"#'tutorial/self-or-not-hello-to-grape!"}
;; <=

;; **
;;; Constraints defined in clausal form can be applied to Grapes in the same way as atomic constraints, except that their negation is not defined. See below for an example.
;; **

;; @@
(-> (newgrape) hello world vine self-or-not-hello-to-grape!)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;fd2e242c-5eb5-4cb4-8ee3-93684f9983de&quot;</span>","value":"\"fd2e242c-5eb5-4cb4-8ee3-93684f9983de\""}],"value":"(\"fd2e242c-5eb5-4cb4-8ee3-93684f9983de\")"}
;; <=

;; **
;;; # 7. Schemas
;;; 
;;; In contrast to most other graph transformation tools, @@GrapeVine@@ graphs do not need to be typed. We believe that schema-less programming promotes exploration and evolution. 
;;; 
;;; However, it is quite possible to define graph schemas if consistency constraints should be enforced. It is up to the user to choose how much or how little schema they desire. 
;;; 
;;; Schemas are defined using the __`schema`__ form
;;; 
;;; Syntax: __`(schema name [c1 ... cn])`__, where 
;;; * `name` is a name for the schema, and
;;; * `c1` .. `cn` are constraints.
;;; 
;;; Let's consider a simple example. We define a constraint that forbids the existence of a `Hello` node with multiple outgoing `to` edges. We do so by defining an existential constraint and then using its negation:
;; **

;; @@
(constraint multiple-to! []
       (node h:Hello)
       (node n1)
       (node n2)
       (edge :to h n1)
       (edge :to h n2))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"243\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x62692d25 \"BufferedImage@62692d25: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 243 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Let's define a schema and call it `myschema`:
;; **

;; @@
(schema myschema [multiple-to!-])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/myschema</span>","value":"#'tutorial/myschema"}
;; <=

;; **
;;; At this point, the schema has been defined, but it has not been attached to any graph yet. Let's define two graphs and attach the schema to one of them:
;; **

;; @@
(def g1 (newgrape))
(def g2 (newgrape))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/g2</span>","value":"#'tutorial/g2"}
;; <=

;; @@
(myschema g2)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;bf0de3e4-7de5-4897-8913-4de57fcbaf85&quot;</span>","value":"\"bf0de3e4-7de5-4897-8913-4de57fcbaf85\""}],"value":"(\"bf0de3e4-7de5-4897-8913-4de57fcbaf85\")"}
;; <=

;; **
;;; The above command as attached our schema to graph `g2`.
;;; 
;;; Note that a schema is just a function on graphs (@@grapes@@). So, we could also just write the following:
;; **

;; **
;;; 
;; **

;; @@
(def g2 (-> (newgrape) myschema))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/g2</span>","value":"#'tutorial/g2"}
;; <=

;; **
;;; 
;; **

;; **
;;; Now let's see the effect of the schema constraint. The following derivation should not be allowed in the schema that's attached to graph `g2` since it would create a `Hello` node connected to two `World` nodes:
;; **

;; @@
(-> g2 hello world world)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; Indeed, the above operation returns no graph (an empty @@grape@@). 
;;; 
;;; Of course, applying the same to our schemaless graph works without a problem:
;; **

;; @@
(-> g1 hello world world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"431\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6418667 \"BufferedImage@6418667: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 431 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x6418667 \"BufferedImage@6418667: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 431 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 431, :height 251})"}
;; <=

;; **
;;; >_Note: Schema constraints are "inherited" during derivation. In other words, a graph that was created as a result of a rule application has the same schema as the graph it was derived from. _
;; **

;; **
;;; 
;; **

;; **
;;; 
;; **

;; **
;;; ## 7.1 Listing and Dropping Schema Constraints
;;; 
;;; We can list the schema constraints defined on a graph using the `__schema-list__` form. For example:
;; **

;; @@
(schema-list g2)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"list-like","open":"<span class='clj-map'>{</span>","close":"<span class='clj-map'>}</span>","separator":", ","items":[{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:graph</span>","value":":graph"},{"type":"html","content":"<span class='clj-string'>&quot;bf0de3e4-7de5-4897-8913-4de57fcbaf85&quot;</span>","value":"\"bf0de3e4-7de5-4897-8913-4de57fcbaf85\""}],"value":"[:graph \"bf0de3e4-7de5-4897-8913-4de57fcbaf85\"]"},{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:constraints</span>","value":":constraints"},{"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}],"value":"[:constraints ()]"}],"value":"{:graph \"bf0de3e4-7de5-4897-8913-4de57fcbaf85\", :constraints ()}"}],"value":"({:graph \"bf0de3e4-7de5-4897-8913-4de57fcbaf85\", :constraints ()})"}],"value":"(({:graph \"bf0de3e4-7de5-4897-8913-4de57fcbaf85\", :constraints ()}))"}
;; <=

;; **
;;; while...
;; **

;; @@
(schema-list g1)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"list-like","open":"<span class='clj-map'>{</span>","close":"<span class='clj-map'>}</span>","separator":", ","items":[{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:graph</span>","value":":graph"},{"type":"html","content":"<span class='clj-string'>&quot;8f107f3b-b895-4394-ad32-195b6c074b34&quot;</span>","value":"\"8f107f3b-b895-4394-ad32-195b6c074b34\""}],"value":"[:graph \"8f107f3b-b895-4394-ad32-195b6c074b34\"]"},{"type":"list-like","open":"","close":"","separator":" ","items":[{"type":"html","content":"<span class='clj-keyword'>:constraints</span>","value":":constraints"},{"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}],"value":"[:constraints ()]"}],"value":"{:graph \"8f107f3b-b895-4394-ad32-195b6c074b34\", :constraints ()}"}],"value":"({:graph \"8f107f3b-b895-4394-ad32-195b6c074b34\", :constraints ()})"}],"value":"(({:graph \"8f107f3b-b895-4394-ad32-195b6c074b34\", :constraints ()}))"}
;; <=

;; **
;;; We can drop constraints by adding a `__drop__` to the schema name. Check out the following example, which drops our schema constraints "just in time" to allow the second application of rule `world`.
;; **

;; @@
(-> g2 hello world myschema-drop world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"423\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1e1a0bee \"BufferedImage@1e1a0bee: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 423 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x1e1a0bee \"BufferedImage@1e1a0bee: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 423 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 423, :height 251})"}
;; <=

;; **
;;; Note that grape `g2` still has our schema constraint attached. The above statement only dropped the constraint from the graph that was derived by applying rules `hello` and `world`.
;;; 
;;; > __Note__: Constraints (and rules) are currently not "stored procedures" in the Neo4J database. The schema is stored in the database only with the names of the constraints. This means that you need to (re)evaluate the declaration of any constraints that are referenced in a graph's schema prior to working with the graph.
;;; 
;;; ## 7.2 Using parameterized constraints in schema definitions
;;; 
;;; Parameterized constraints can also be used in schema definitions, but their parameters must be actualized and they must be given unique names. The __`enforce`__ form is used for this purpose. Consider the following example of a parameterizable version of the `multiple-to` constraint, which takes the label of node `h` as a parameter:
;; **

;; @@
(constraint multiple-to! [lab]
       (node h:&lab)
       (node n1)
       (node n2)
       (edge :to h n1)
       (edge :to h n2))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"265\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x5e652ade \"BufferedImage@5e652ade: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 265 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; The following schema uses the (negated) parameterized `multiple-to!` constraint with parameter `Hello` and names it `hello-to-one`.
;; **

;; @@
(schema myschema [(enforce hello-to-one (multiple-to!- "Hello"))])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/myschema</span>","value":"#'tutorial/myschema"}
;; <=

;; **
;;; ## 7.3 Predefined schema constraints
;;; 
;;; While it is possible to define schema constraints using the general constraint form, @@GrapeVine@@ comes with a list of predefined constraint types, which make schema definition more convinient.
;;; 
;;; Consider for example a constraint that restricts the allowed node types. Defining such a constraint using the above means is possible but combersome. Database schema definitions often go beyond restrictions but also defined efficient search structures like B+ trees for unique keys. 
;;; 
;;; The following predefined constraint types are available:
;;; 
;;; ### 7.3.1 Nodes and Edge Labels
;;; 
;;; We can restrict the allowed node and edge labels with the `__nodelabel__` and `__edgelabel__` forms, respectively. 
;;; 
;;; Syntax: __`(nodelabels conname [l1 ... ln])`__ and __`(nodelabels conname [l1 ... ln])`__, where 
;;; * `conname` is an _optional_ name for the constraint, and
;;; * `l1` .. `ln` are names of (allowed) labels
;;; 
;;; The following example defines a schema that allows only two node labels (`Hello` and `World`) and one edge label (`to`), attaches it to a graph and demonstrates its behaviour.
;; **

;; @@
(schema myschema [
                  (nodelabels [Hello World])
                  (edgelabels	[to])
        ])

(-> (newgrape) myschema hello world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"412\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4e6bcc57 \"BufferedImage@4e6bcc57: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 412 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x4e6bcc57 \"BufferedImage@4e6bcc57: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 412 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 412, :height 251})"}
;; <=

;; **
;;; Now, the following should not be allowed, as it creates a node of type `Grape`.
;; **

;; @@
(vine _)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; ### 7.3.2 Roles
;;; 
;;; The roles that nodes can play in relationships (as sources and targets of edges) can be restricted with the __`sourceroles`__ and __`targetroles`__ forms.
;;; 
;;; Syntax: __`(sourceroles conname edgelabel [l1 l2 ... ln])`__ and __`(targetroles conname edgelabel [l1 l2 ... ln])`__, where
;;; * `conname` is an *optional* name for the constraint,
;;; * `edgelabel` is an edge label, and
;;; * `l1` .. `ln` are labels of nodes that are allowed to play the source or target role of that edge, respectively
;;; 
;;; 
;; **

;; @@
(schema myschema [
                  (sourceroles to [Hello])
                  (targetroles to [World])
                  ])

;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/myschema</span>","value":"#'tutorial/myschema"}
;; <=

;; @@
(-> (newgrape) myschema hello world view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"424\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x695f5944 \"BufferedImage@695f5944: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 424 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x695f5944 \"BufferedImage@695f5944: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 424 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 424, :height 251})"}
;; <=

;; **
;;; Now, the following should not be allowed, since a `Grape` node cannot play the target role for a `to` edge.
;; **

;; @@
(vine _)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; ### 7.3.3 Multiplicity
;;; 
;;; We can constrain the cardinality of relationships (edges) to have a unique target ("to one") and or unique source ("from one").
;;; 
;;; Syntax: __`(to-one conname edgelabel)`__ and __`(from-one conname edgelabel)`__, where
;;; * `conname` is an *optional* name for the constraint, and
;;; * `edgelabel` is an edge label
;;; 
;;; 
;;; 
;; **

;; @@
(schema myschema [
                  (to-one to)
                  ])
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/myschema</span>","value":"#'tutorial/myschema"}
;; <=

;; @@
(-> (newgrape) myschema hello world vine view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"428\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6a34bb0e \"BufferedImage@6a34bb0e: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 428 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x6a34bb0e \"BufferedImage@6a34bb0e: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 428 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 428, :height 251})"}
;; <=

;; **
;;; But the following does not work:
;; **

;; @@
(-> (newgrape) myschema hello world world)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; ### 7.3.4 Attribute uniqueness
;;; 
;;; We can define attributes to be unique for all nodes of a particular label:
;;; 
;;; Syntax: __`(unique conname nodelabel attname)`__, where
;;; * `conname` is an *optional* name for the constraint, 
;;; * `nodelabel` is a node label, and
;;; * `attname` is an attribute name
;;; 
;;; 
;; **

;; @@
(rule add-person [s]
      (create (node :Person {:SIN "'&s'"})))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"203\" height=\"147\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xe33116 \"BufferedImage@e33116: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5e734f5e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 203 height = 147 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; @@
(schema myschema [
                  (unique Person SIN)
                  ])


(-> (newgrape) myschema (add-person 123) (add-person 123) view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; # 8. Graph Queries
;;; 
;;; Graph queries are used to extract data from a graph (for further processing in the host language Clojjure) and to visualize parts of interest.
;;; 
;;; By convention and to distinguish queries from rules and constraints, names of queries should be appended with a question mark (**?**).
;;; 
;;; Like rules and constraints, queries can be applied to @@grapes@@, but they return a relation for each graph in the @@grape@@.
;;; 
;;; Consider the following query as an example:
;; **

;; @@
(query hello-to? []
     (node h:Hello)
     (node x)
     (edge :to h x))
